import React from 'react'
import './navbar.css'

const navbar = () => {
    return (
        <div className='navbar-container'>
            <div className='links-container'>
                <img src="..\images\react-logo.png" alt="" />
                <a href="/">Home</a>
            </div>
        </div>
    )
}

export default navbar
